import './App.css';
import image from './shop.png';

function App() {
  return (
    <div>
      <img src={image} width='300px' alt='shop' />
      <h1>Grocery list</h1>
      <img src='imageTwo' width='300px' alt='man' />
    </div>
  );
}

export default App;
